svg.script:

window.onload = function() {
	const loadingScreen = document.getElementById("loadingScreen");
	const page = document.getElementById("page");
	const shadowOverlay = document.getElementById("shadowOverlay");
	const cart = document.getElementById("cart");
	const cursors = document.getElementById("cursors");
	const handCursor = document.getElementById("handCursor");
	const pointerCursor = document.getElementById("pointerCursor");
	const cartBtn = document.getElementById("cartBtn");

	function resetStage() {
		window.setTimeout(() => {
			loadingScreen.classList.remove("hidden");
			cursors.classList.remove("mouseOver");
			handCursor.classList.remove("visible");
			pointerCursor.classList.remove("hidden");
			shadowOverlay.classList.remove("visible");
			cart.classList.remove("visible");
			page.classList.remove("scrolling");
			cartBtn.classList.remove("active");
			firstScene();
		}, 1000);
	}

	function fourthScene() {
		cursors.classList.add("mouseOver");

		window.setTimeout(() => {
			handCursor.classList.add("visible");
			pointerCursor.classList.add("hidden");
		}, 2000);

		window.setTimeout(() => {
			cartBtn.classList.add("active");
			resetStage();
		}, 2500);
	}

	function thirdScene() {
		shadowOverlay.classList.add("visible");
		cart.addEventListener("transitionend", fourthScene);
		cart.classList.add("visible");
	}

	function secondScene() {
		page.addEventListener("animationend", thirdScene);
		page.classList.add("scrolling");
	}

	function firstScene() {
		window.setTimeout(() => {
			loadingScreen.classList.add("hidden");
			secondScene();
		}, 3000);
	}
	firstScene();
};
